import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => (
  <header>
    <h1>Your Name</h1>
    <nav>
      <Link to="/">Home</Link>
      <Link to="/blog">Blog</Link>
      <Link to="/portfolio">Portfolio</Link>
      <Link to="/about">About</Link>
      <Link to="/contact">Contact</Link>
    </nav>
  </header>
);

export default Header;
